import React from "react";
import {
  StyleSheet,
  Text,
  View,
  KeyboardAvoidingView,
  ImageBackground,
  TextInput,
} from 'react-native';
import { ThemeProvider, Input, } from "react-native-elements";
import Icon from 'react-native-vector-icons/FontAwesome';


const Background = () => {
  return (
    <ImageBackground source={require('./img/background.jpg')}/>
  )
}


const Profile = () => {
  return(
  <ThemeProvider>
    <ImageBackground source={require('./img/background.jpg')}></ImageBackground>
    </ThemeProvider>
  )
};


const styles = StyleSheet.create({

  backgroundImage:{
    width: '100%',
    height: '100%',
  },

  Icon:{
    paddingRight: 10,
  },
})




export default Profile;
